import React from "react";
import "./about.css";

const About = () => {
  return (
    <section className="about" id="about">
      <h2 className="about-title">About <span className="about">Me</span></h2>

      <p className="about-para">
        I’m <strong>Shruti Gour</strong>, a Computer Science Engineering graduate
        (2020–2024) from Shri Vaishnav Institute of Information Technology,
        Indore, with a CGPA of <strong>7.1</strong>.
        <br /><br />
        I’m passionate about <strong>frontend development and design</strong>,
        skilled in HTML, CSS, JavaScript, and React. I enjoy building visually
        appealing, responsive web applications with clean UI and smooth user
        experiences.
        <br /><br />
        As a fresher, I’m eager to learn, grow, and contribute to meaningful
        projects while continuously improving my skills.
      </p>
    </section>
  );
};

export default About;
